import React,{Fragment} from 'react'

const Footer = () => {
    return (
        <Fragment>
             <footer classNameName="py-1 d-flex justify-content-center">
      <p classNameName=" text-center text-dark mt-1">
        Shopping Cart - 2019-2020, All Rights Reserved
      </p>
    </footer>


    </Fragment>
            
    )
}

export default Footer
